import React, { useState } from "react";
import Login from "./Login";
import Chat from "./Chat";

function App() {
  const [loggedIn, setLoggedIn] = useState(false);

  return (
    <div>
      {!loggedIn ? (
        <Login onLogin={() => setLoggedIn(true)} />
      ) : (
        <Chat />
      )}
    </div>
  );
}

export default App;
